import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
  <header style={headerStyle}>
    <div style={brandWrapperStyle}>
      <img
        src="/assets/GFX_logo.jpg"
        alt="Millennial Logo"
        style={logoStyle}
      />
      <span style={brandTextStyle}>Millennial GFX</span>
    </div>

    <nav style={navStyle}>
      <Link to="/" style={linkStyle}>Home</Link>
      <Link to="/about" style={linkStyle}>About</Link>
      <Link to="/services" style={linkStyle}>Services</Link>
      <Link to="/portfolio" style={linkStyle}>Portfolio</Link>
      <Link to="/contact" style={linkStyle}>Contact</Link>
    </nav>
  </header>
);

const headerStyle = {
  backgroundColor: '#0a0a36',
  color: '#fff',
  padding: '10px 30px',
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  borderBottom: '1px solid #222',
};

const brandWrapperStyle = {
  display: 'flex',
  alignItems: 'center',
  gap: '10px',
};

const logoStyle = {
  height: '28px',
  width: '28px',
  objectFit: 'contain',
};

const brandTextStyle = {
  fontSize: '1.25rem',
  fontWeight: '600',
};

const navStyle = {
  display: 'flex',
  gap: '24px',
};

const linkStyle = {
  color: '#fff',
  textDecoration: 'none',
  fontWeight: '500',
  fontSize: '0.95rem',
};

export default Header;
